def clear_aws():
    users = cognito.list_users(
        UserPoolId=environ.get('AWS_COGNITO_POOL_ID'),
        AttributesToGet=[]
    )

    for user in users['Users']:
        cognito.admin_delete_user(
            UserPoolId=environ.get('AWS_COGNITO_POOL_ID'),
            Username=user['Username']
        )

    files_to_delete = []
    files = s3.list_objects_v2(Bucket='gametime-file-storage')
    if files['KeyCount'] != 0:
        for file in files['Contents']:
            files_to_delete.append({
                'Key': file['Key']
            })

        s3.delete_objects(
            Bucket='gametime-file-storage',
            Delete={
                'Objects': files_to_delete
            }
        )


def create_user(first_name, last_name):
    email = f'{first_name}{last_name}@hubermjonathan.com'
    password = 'TestTest123123'

    cognito_request = requests.post(
        'https://1sz21h77li.execute-api.us-east-2.amazonaws.com/Dev/signup',
        data=json.dumps({
            'phone': test_phone,
            'email': email,
            'password': password,
            'firstname': first_name,
            'lastname': last_name
        })
    )

    cognito.admin_confirm_sign_up(
        UserPoolId=environ.get('AWS_COGNITO_POOL_ID'),
        Username=cognito_request.json()['user']['UserSub']
    )

    user = db.users.create_user(
        cognito_request.json()['user']['UserSub'], first_name, last_name, email, test_phone)
    return user[2]['user_id']


